{
  "printWidth": 180,
  "singleQuote": true,
  "htmlWhitespaceSensitivity": "strict",
  "trailingComma": "es5",
  "overrides": [
    {
      "files": [
        "*.html"
      ],
      "options": {
        "parser": "angular"
      }
    },
    {
      "files": [
        "*.{j,t}sx",
        "*.ts"
      ],
      "options": {
        "printWidth": 80
      }
    }
  ]
}

module.exports = {
  plugins: ['lodash', 'angularjs-annotate'],
  presets: [
    [
      '@babel/preset-env',
      {
        useBuiltIns: 'usage',
        corejs: '3',
        targets: { node: 'current' },
        modules: 'auto',
      },
    ],
  ],
  overrides: [
    {
      test: ['app/**/*.ts', 'app/**/*.tsx'],
      presets: [
        '@babel/preset-typescript',
        [
          '@babel/preset-react',
          {
            runtime: 'automatic',
          },
        ],
        [
          '@babel/preset-env',
          {
            modules: 'auto',
            useBuiltIns: 'usage',
            corejs: '3',
          },
        ],
      ],
    },
  ],
};

{
  "compilerOptions": {
    "target": "es2017",
    "allowSyntheticDefaultImports": false,
    "module": "commonjs"
  },

  "extends": "./tsconfig.json"
}

module.exports = {
  '*.(js|ts){,x}': 'yarn lint',
  '*.(ts){,x}': () => 'tsc --noEmit',
  '*.{js,ts,tsx,css,md,html,json}': 'yarn format',
  '*.go': () => 'make lint-server',
};

module.exports = function (plop) {
  // use of INIT_CWD instead of process.cwd() because yarn changes the cwd
  const cwd = process.env.INIT_CWD;
  plop.addHelper('cwd', () => cwd);
  plop.setGenerator('component', {
    prompts: [
      {
        type: 'input',
        name: 'name',
        message: 'component name please',
      },
      {
        type: 'input',
        name: 'module',
        message: 'module name please',
        default: `${getCurrentPortainerModule(cwd)}`,
        // when: false
      },
    ], // array of inquirer prompts
    actions: [
      {
        type: 'add',
        path: `{{cwd}}/{{dashCase name}}/index.js`,
        templateFile: './plop-templates/component.js.hbs',
      },
      {
        type: 'add',
        path: `{{cwd}}/{{dashCase name}}/{{dashCase name}}.controller.js`,
        templateFile: './plop-templates/component-controller.js.hbs',
      },
      {
        type: 'add',
        path: `{{cwd}}/{{dashCase name}}/{{dashCase name}}.html`,
        templateFile: './plop-templates/component.html.hbs',
      },
    ], // array of actions
  });
};

function getCurrentPortainerModule(cwd) {
  const match = cwd.match(/\/app\/([^\/]*)(\/.*)?$/);
  if (!match || !match.length || match[1] === 'portainer') {
    return 'app';
  }
  return match[1];
}

module.exports = ({ env }) => ({
  plugins: [
    // add vendor prefixes
    require('autoprefixer'),
    // minify the result
    env !== 'development' && require('cssnano'),
    require('tailwindcss'),
  ],
});

const plugin = require('tailwindcss/plugin');
const defaultTheme = require('tailwindcss/defaultTheme');
const colors = require('./app/assets/css/colors.json');

/** @type {import('tailwindcss').Config} */
module.exports = {
  content: ['./app/**/*.{html,tsx}'],
  corePlugins: {
    preflight: false,
  },
  theme: {
    colors: {
      transparent: 'transparent',
      current: 'currentColor',
      inherit: 'inherit',
      ...colors,

      'legacy-grey-3': 'var(--grey-3)',
      'legacy-blue-2': 'var(--blue-2)',
      'legacy-blue-9': 'var(--blue-9)',
    },
    extend: {
      fontFamily: {
        sans: ['Inter', ...defaultTheme.fontFamily.sans],
      },
      animation: {
        'spin-slow': 'spin 2s linear infinite',
      },
    },
  },

  plugins: [
    plugin(({ addVariant }) => {
      addVariant('be', '&:is([data-edition="BE"] *)');
      addVariant('th-highcontrast', '&:is([theme="highcontrast"] *)');
      addVariant('th-dark', '&:is([theme="dark"] *)');
    }),
    plugin(function ({ addVariant }) {
      addVariant('progress-filled', ['&::-webkit-progress-value', '&::-moz-progress-bar']);
    }),
  ],
};

/// <reference types="vitest" />
import { defineConfig } from 'vite';
import tsconfigPaths from 'vite-tsconfig-paths';
import svgr from 'vite-plugin-svgr';

export default defineConfig({
  test: {
    globals: true,
    environment: 'jsdom',
    setupFiles: ['./app/setup-tests/setup-msw.ts', './app/setup-tests/stub-modules.ts', './app/setup-tests/setup.ts', './app/setup-tests/setup-rtl.ts'],
    coverage: {
      provider: 'v8',
      reporter: ['text', 'json', 'html'],      
      exclude: ['node_modules/', 'app/setup-tests/global-setup.js'],
    },
    bail: 2,
    include: ['./app/**/*.test.ts', './app/**/*.test.tsx'],
    env: {
      PORTAINER_EDITION: 'CE',
    },
  },
  plugins: [svgr({ include: /\?c$/ }), tsconfigPaths()],
});
